import React from 'react';
import Tablexml from './Tablexml';
import { parseString } from 'xml2js';

class Pubmed extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            items: [],
            isLoaded: false,
        };
    }

    componentDidMount() {
        fetch('http://localhost:9000/pubmed')
            .then(res => res.text())
            .then(data => {
                this.setState({
                    isLoaded: true,
                    items: data,
                })
            });
    }

    showResult(xmlDoc) {
        removeWhitespace(xmlDoc);
        var outputResult = document.getElementById("BodyRows");
        var rowData = xmlDoc.getElementsByTagName("Employee");

        addTableRowsFromXmlDoc(rowData, outputResult);
    }

    render() {

        var isLoaded = this.state.isLoaded;
        var items = this.state.items;
        showResult(items);
        console.log(items, 'items');

        if (!isLoaded) {
            return <div>Loading...</div>;
        }

        else {
            return (
                <table id="MainTable">
                    <tbody id="BodyRows"></tbody>
                </table>
                // <div className="App">
                //     <Tablexml data={items} />
                // </div>
            )

        }

    }
}
export default Pubmed;
